  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset estimates green
  space along walkable roads. Green space within 25 meters of the road centerline
  is included and the percentage is based on the total area between street intersections.
  Green space provides valuable benefits to neighborhood residents and walkers by
  providing shade, improved aesthetics, and outdoor gathering spaces. This dataset
  was produced by the US EPA to support research and online mapping activities related
  to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
  interact with a web-based, easy-to-use, mapping application to view and analyze
  multiple ecosystem services for the contiguous United States. The dataset is available
  as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
  EnviroAtlas map service. Additional descriptive information about each attribute
  in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets
  ).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
